import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <div>
    <h1>Hello world!</h1>
    <ul>
      <li>Lorem ipsum dolor sit amet.</li>
      <li>Consectetur adipisicing elit. Amet, animi!</li>
      <li>Sed velit quos architecto laborum tenetur delectus!</li>
    </ul>
  </div>
);


